Big Mommas: Like Father, Like Son 

Genre - Comedy 



FBI agent Malcolm Turner and his 17-year-old son, Trent, go undercover at 
an all-girls performing arts school after Trent witnesses a murder. Posing 
as Big Momma and Charmaine, they must find the murderer before he finds them. 



Director:John Whitesell

Writers:Matthew Fogel (screenplay), Don Rhymer (story)

Stars:Martin Lawrence, Brandon T. Jackson and Jessica Lucas 




